    // >>> Solve(("#a@C"))
    // ("#A@c")
    public static string Solve(string s) {
        // Reverse the string.
        string result = "";
        for (int i = s.Length - 1; i >= 0; i--) {
            if (s[i] == 'a' || s[i] == 'A') {
                result = result + s[i];
            }
        }
        return result;

